INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 190804, 1, 1, 0, 0, 60000, 1, "カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60000, 2, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60000, 3, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 1, 60000, 4, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60000, 5, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60000, 6, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 2, 60000, 7, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60000, 8, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60000, 9, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60000, 10, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60000, 11, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 3, 60000, 12, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60000, 13, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60000, 14, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60000, 15, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60000, 16, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 4, 60000, 17, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190804, 3, 2, 0, 0, 60000, 18, "カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190804, 3, 3, 0, 0, 60000, 19, "カリン", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101201, 0, 1, 0, 0, 80001, 20, "ハツネ", 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101201, 0, 2, 0, 0, 80001, 21, "ハツネ", 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103801, 1, 1, 0, 0, 80001, 22, "シオリ", 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103801, 1, 2, 0, 0, 80001, 23, "シオリ", 1, "来年も、\n一緒にいられたら…\nうれしいな", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103601, 0, 1, 0, 0, 80001, 24, "キョウカ", 2, "あなたと一緒にいるようになって、\nもう1年ですか…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103601, 0, 2, 0, 0, 80001, 25, "キョウカ", 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102001, 1, 1, 0, 0, 80001, 26, "ミミ", 2, "おにいちゃんとあってから、\n1年たったよ～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102001, 1, 2, 0, 0, 80001, 27, "ミミ", 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100401, 2, 1, 0, 0, 80001, 28, "ミソギ", 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100401, 2, 2, 0, 0, 80001, 29, "ミソギ", 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101001, 0, 1, 0, 0, 80001, 30, "マホ", 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101001, 0, 2, 0, 0, 80001, 31, "マホ", 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104401, 1, 1, 0, 0, 80001, 32, "イリヤ", 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104401, 1, 2, 0, 0, 80001, 33, "イリヤ", 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101701, 2, 1, 0, 0, 80001, 34, "カオリ", 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101701, 2, 2, 0, 0, 80001, 35, "カオリ", 3, "これからも、どうぞよろしく\nお願いするさ～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102801, 0, 1, 0, 0, 80001, 36, "サレン", 4, "あんたと出会ってからもうそんなに\nたつのね～", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102801, 0, 2, 0, 0, 80001, 37, "サレン", 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102501, 1, 1, 0, 0, 80001, 38, "スズメ", 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102501, 1, 2, 0, 0, 80001, 39, "スズメ", 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104601, 0, 1, 0, 0, 80001, 40, "タマキ", 5, "振り返れば、今までいろんなことが\nあったにゃあ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104601, 0, 2, 0, 0, 80001, 41, "タマキ", 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104801, 1, 1, 0, 0, 80001, 42, "ミフユ", 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104801, 1, 2, 0, 0, 80001, 43, "ミフユ", 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103201, 0, 1, 0, 0, 80001, 44, "アキノ", 6, "あなたさまと出会ってもう1年…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103201, 0, 2, 0, 0, 80001, 45, "アキノ", 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103401, 1, 1, 0, 0, 80001, 46, "ユカリ", 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103401, 1, 2, 0, 0, 80001, 47, "ユカリ", 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 107101, 0, 1, 0, 0, 80001, 48, "クリスティーナ", 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 107101, 0, 2, 0, 0, 80001, 49, "クリスティーナ", 7, "ともかくこれからも\n愉しませてくれよ☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104701, 1, 1, 0, 0, 80001, 50, "ジュン", 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104701, 1, 2, 0, 0, 80001, 51, "ジュン", 7, "見えないから分からないって？\nそれもそうだな…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103701, 0, 1, 0, 0, 80001, 52, "トモ", 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103701, 0, 2, 0, 0, 80001, 53, "トモ", 8, "これからもよろしくね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100501, 1, 1, 0, 0, 80001, 54, "マツリ", 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100501, 1, 2, 0, 0, 80001, 55, "マツリ", 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100701, 0, 1, 0, 0, 80001, 56, "ミヤコ", 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100701, 0, 2, 0, 0, 80001, 57, "ミヤコ", 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103101, 1, 1, 0, 0, 80001, 58, "シノブ", 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 103101, 1, 2, 0, 0, 80001, 59, "シノブ", 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100901, 0, 1, 0, 0, 80001, 60, "アンナ", 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100901, 0, 2, 0, 0, 80001, 61, "アンナ", 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101301, 1, 1, 0, 0, 80001, 62, "ナナカ", 10, "君と出会ってもう1年だって！\n早いねー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101301, 1, 2, 0, 0, 80001, 63, "ナナカ", 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105101, 0, 1, 0, 0, 80001, 64, "ミツキ", 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105101, 0, 2, 0, 0, 80001, 65, "ミツキ", 11, "これからも、いろんなところを\n調べさせてね？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105601, 1, 1, 0, 0, 80001, 66, "ルカ", 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105601, 1, 2, 0, 0, 80001, 67, "ルカ", 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102701, 2, 1, 0, 0, 80001, 68, "エリコ", 11, "早いものですわね、あなた様と\nお会いして、もう1年…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102701, 2, 2, 0, 0, 80001, 69, "エリコ", 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102301, 0, 1, 0, 0, 80001, 70, "アヤネ", 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102301, 0, 2, 0, 0, 80001, 71, "アヤネ", 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104201, 1, 1, 0, 0, 80001, 72, "チカ", 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104201, 1, 2, 0, 0, 80001, 73, "チカ", 12, "私のことを見守ってください\nできることなら、ずっと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102101, 2, 1, 0, 0, 80001, 74, "クルミ", 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 102101, 2, 2, 0, 0, 80001, 75, "クルミ", 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104901, 0, 1, 0, 0, 80001, 76, "シズル", 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 104901, 0, 2, 0, 0, 80001, 77, "シズル", 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101101, 1, 1, 0, 0, 80001, 78, "リノ", 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 101101, 1, 2, 0, 0, 80001, 79, "リノ", 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100201, 0, 1, 0, 0, 80001, 80, "ユイ", 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100201, 0, 2, 0, 0, 80001, 81, "ユイ", 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100101, 1, 1, 0, 0, 80001, 82, "ヒヨリ", 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100101, 1, 2, 0, 0, 80001, 83, "ヒヨリ", 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100301, 2, 1, 0, 0, 80001, 84, "レイ", 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 100301, 2, 2, 0, 0, 80001, 85, "レイ", 14, "キミに背中を預けられる日が、\n早くきますように", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 1, 0, 0, 80001, 86, "ペコリーヌ", 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 2, 0, 0, 80001, 87, "ペコリーヌ", 15, "これからもずっと、覚えていて\nくださいね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 1, 0, 0, 80001, 88, "コッコロ", 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 2, 0, 0, 80001, 89, "コッコロ", 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 1, 0, 0, 80001, 90, "キャル", 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 2, 0, 0, 80001, 91, "キャル", 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 112101, 1, 1, 0, 0, 60001, 92, "スズメ", 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60001, 93, "", 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60001, 94, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60001, 95, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60001, 96, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 1, 60001, 97, "", 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60001, 98, "", 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60001, 99, "", 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60001, 100, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60001, 101, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 2, 60001, 102, "", 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 103, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 104, "", 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 105, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 106, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 107, "", 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60001, 108, "", 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 3, 60001, 109, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 110, "", 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 111, "", 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 112, "", 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 113, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 114, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60001, 115, "", 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 4, 60001, 116, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 112101, 3, 2, 0, 0, 60001, 117, "スズメ", 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 112101, 3, 3, 0, 0, 60001, 118, "スズメ", 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 1, 0, 0, 80003, 119, "ペコリーヌ", 1, "ヒューヒュー♪\nドンドンパフパフー♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 1, 0, 0, 80003, 120, "コッコロ", 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 2, 0, 0, 80003, 121, "コッコロ", 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 1, 0, 0, 80003, 122, "キャル", 1, "え？　ちょっと\nいきなりなにっ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 2, 0, 0, 80003, 123, "キャル", 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 2, 0, 0, 80003, 124, "ペコリーヌ", 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 3, 0, 0, 80003, 125, "ペコリーヌ", 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 3, 0, 0, 80003, 126, "コッコロ", 1, "ですからその日に向けて\n今から気分を盛り上げているのです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 3, 0, 0, 80003, 127, "キャル", 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 4, 0, 0, 80003, 128, "コッコロ", 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 4, 0, 0, 80003, 129, "ペコリーヌ", 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 4, 0, 0, 80003, 130, "キャル", 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 5, 0, 0, 80003, 131, "コッコロ", 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 5, 0, 0, 80003, 132, "キャル", 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 1, 1, 0, 0, 80003, 133, "カリン", 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 6, 0, 0, 80003, 134, "キャル", 2, "げっ…カリンじゃない\nなんでもないわよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 1, 2, 0, 0, 80003, 135, "カリン", 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 7, 0, 0, 80003, 136, "キャル", 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 1, 3, 0, 0, 80003, 137, "カリン", 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 8, 0, 0, 80003, 138, "キャル", 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 9, 0, 0, 80003, 139, "キャル", 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 1, 4, 0, 0, 80003, 140, "カリン", 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 10, 0, 0, 80003, 141, "キャル", 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 1, 5, 0, 0, 80003, 142, "カリン", 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 11, 0, 0, 80003, 143, "キャル", 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 6, 0, 0, 80003, 144, "コッコロ", 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 5, 0, 0, 80003, 145, "ペコリーヌ", 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 7, 0, 0, 80003, 146, "コッコロ", 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 8, 0, 0, 80003, 147, "コッコロ", 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 6, 0, 0, 80003, 148, "ペコリーヌ", 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 7, 0, 0, 80003, 149, "ペコリーヌ", 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 9, 0, 0, 80003, 150, "コッコロ", 3, "あとは、牧場に素敵な温泉が\n出来たとか…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 8, 0, 0, 80003, 151, "ペコリーヌ", 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 10, 0, 0, 80003, 152, "コッコロ", 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 9, 0, 0, 80003, 153, "ペコリーヌ", 3, "えへへ、ありがとうございます\nコッコロちゃん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 11, 0, 0, 80003, 154, "コッコロ", 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 1, 10, 0, 0, 80003, 155, "ペコリーヌ", 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 11, 0, 0, 80003, 156, "ペコリーヌ", 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 12, 0, 0, 80003, 157, "キャル", 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 12, 0, 0, 80003, 158, "ペコリーヌ", 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 13, 0, 0, 80003, 159, "キャル", 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 13, 0, 0, 80003, 160, "ペコリーヌ", 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 14, 0, 0, 80003, 161, "キャル", 4, "…積極的？\nなんの話よ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 14, 0, 0, 80003, 162, "ペコリーヌ", 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 15, 0, 0, 80003, 163, "ペコリーヌ", 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 15, 0, 0, 80003, 164, "キャル", 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 16, 0, 0, 80003, 165, "ペコリーヌ", 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 16, 0, 0, 80003, 166, "キャル", 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 17, 0, 0, 80003, 167, "キャル", 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 18, 0, 0, 80003, 168, "キャル", 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 12, 0, 0, 80003, 169, "コッコロ", 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 19, 0, 0, 80003, 170, "キャル", 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 13, 0, 0, 80003, 171, "コッコロ", 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 20, 0, 0, 80003, 172, "キャル", 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 14, 0, 0, 80003, 173, "コッコロ", 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 21, 0, 0, 80003, 174, "キャル", 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 15, 0, 0, 80003, 175, "コッコロ", 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 22, 0, 0, 80003, 176, "キャル", 5, "かくし芸？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 16, 0, 0, 80003, 177, "コッコロ", 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 23, 0, 0, 80003, 178, "キャル", 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 17, 0, 0, 80003, 179, "ペコリーヌ", 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 24, 0, 0, 80003, 180, "キャル", 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 17, 0, 0, 80003, 181, "コッコロ", 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 18, 0, 0, 80003, 182, "ペコリーヌ", 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 25, 0, 0, 80003, 183, "キャル", 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 18, 0, 0, 80003, 184, "コッコロ", 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 26, 0, 0, 80003, 185, "キャル", 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 27, 0, 0, 80003, 186, "キャル", 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 28, 0, 0, 80003, 187, "キャル", 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 19, 0, 0, 80003, 188, "ペコリーヌ", 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 19, 0, 0, 80003, 189, "コッコロ", 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 29, 0, 0, 80003, 190, "キャル", 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 30, 0, 0, 80003, 191, "キャル", 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 31, 0, 0, 80003, 192, "キャル", 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 32, 0, 0, 80003, 193, "キャル", 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 33, 0, 0, 80003, 194, "キャル", 7, "あー\nあー\n…声、これで大丈夫かしら？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 34, 0, 0, 80003, 195, "キャル", 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 35, 0, 0, 80003, 196, "キャル", 7, "オイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 36, 0, 0, 80003, 197, "キャル", 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 37, 0, 0, 80003, 198, "キャル", 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 38, 0, 0, 80003, 199, "キャル", 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 20, 0, 0, 80003, 200, "コッコロ", 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 21, 0, 0, 80003, 201, "コッコロ", 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 22, 0, 0, 80003, 202, "コッコロ", 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 23, 0, 0, 80003, 203, "コッコロ", 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 24, 0, 0, 80003, 204, "コッコロ", 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 25, 0, 0, 80003, 205, "コッコロ", 8, "オイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 26, 0, 0, 80003, 206, "コッコロ", 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 27, 0, 0, 80003, 207, "コッコロ", 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 28, 0, 0, 80003, 208, "コッコロ", 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 20, 0, 0, 80003, 209, "ペコリーヌ", 9, "オイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 21, 0, 0, 80003, 210, "ペコリーヌ", 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 22, 0, 0, 80003, 211, "ペコリーヌ", 9, "あと６日で2.5周年ですか…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 23, 0, 0, 80003, 212, "ペコリーヌ", 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 24, 0, 0, 80003, 213, "ペコリーヌ", 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 25, 0, 0, 80003, 214, "ペコリーヌ", 9, "オイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 26, 0, 0, 80003, 215, "ペコリーヌ", 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 27, 0, 0, 80003, 216, "ペコリーヌ", 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 28, 0, 0, 80003, 217, "ペコリーヌ", 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 29, 0, 0, 80003, 218, "ペコリーヌ", 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 30, 0, 0, 80003, 219, "ペコリーヌ", 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 31, 0, 0, 80003, 220, "ペコリーヌ", 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 29, 0, 0, 80003, 221, "コッコロ", 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 32, 0, 0, 80003, 222, "ペコリーヌ", 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 39, 0, 0, 80003, 223, "キャル", 10, "…………", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 30, 0, 0, 80003, 224, "コッコロ", 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 40, 0, 0, 80003, 225, "キャル", 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 33, 0, 0, 80003, 226, "ペコリーヌ", 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 41, 0, 0, 80003, 227, "キャル", 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 34, 0, 0, 80003, 228, "ペコリーヌ", 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 35, 0, 0, 80003, 229, "ペコリーヌ", 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 42, 0, 0, 80003, 230, "キャル", 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 31, 0, 0, 80003, 231, "コッコロ", 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 43, 0, 0, 80003, 232, "キャル", 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 36, 0, 0, 80003, 233, "ペコリーヌ", 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 6, 0, 0, 80003, 234, "カリン", 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 7, 0, 0, 80003, 235, "カリン", 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 8, 0, 0, 80003, 236, "カリン", 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 9, 0, 0, 80003, 237, "カリン", 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 10, 0, 0, 80003, 238, "カリン", 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 11, 0, 0, 80003, 239, "カリン", 11, "次にコッコロさんですが\nこちらは発声練習をしています", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 12, 0, 0, 80003, 240, "カリン", 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 13, 0, 0, 80003, 241, "カリン", 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 14, 0, 0, 80003, 242, "カリン", 11, "あれ？\nもしかして緊張で気を失って…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 15, 0, 0, 80003, 243, "カリン", 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 16, 0, 0, 80003, 244, "カリン", 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 17, 0, 0, 80003, 245, "カリン", 11, "それでは\nまた明日お会いしましょう♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 44, 0, 0, 80003, 246, "キャル", 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 2, 37, 0, 0, 80003, 247, "ペコリーヌ", 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 32, 0, 0, 80003, 248, "コッコロ", 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 45, 0, 0, 80003, 249, "キャル", 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 2, 38, 0, 0, 80003, 250, "ペコリーヌ", 12, "ひどいですよぉキャルちゃ～ん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 33, 0, 0, 80003, 251, "コッコロ", 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 2, 39, 0, 0, 80003, 252, "ペコリーヌ", 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 46, 0, 0, 80003, 253, "キャル", 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 34, 0, 0, 80003, 254, "コッコロ", 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 2, 40, 0, 0, 80003, 255, "ペコリーヌ", 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 41, 0, 0, 80003, 256, "ペコリーヌ", 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 47, 0, 0, 80003, 257, "キャル", 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 42, 0, 0, 80003, 258, "ペコリーヌ", 13, "忘れてきちゃいました☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 48, 0, 0, 80003, 259, "キャル", 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 35, 0, 0, 80003, 260, "コッコロ", 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 49, 0, 0, 80003, 261, "キャル", 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 43, 0, 0, 80003, 262, "ペコリーヌ", 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 50, 0, 0, 80003, 263, "キャル", 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 36, 0, 0, 80003, 264, "コッコロ", 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 51, 0, 0, 80003, 265, "キャル", 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 37, 0, 0, 80003, 266, "コッコロ", 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 52, 0, 0, 80003, 267, "キャル", 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 44, 0, 0, 80003, 268, "ペコリーヌ", 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 38, 0, 0, 80003, 269, "コッコロ", 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 45, 0, 0, 80003, 270, "ペコリーヌ", 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 53, 0, 0, 80003, 271, "キャル", 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 46, 0, 0, 80003, 272, "ペコリーヌ", 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 18, 0, 0, 80003, 273, "カリン", 14, "こんにちは\n【ギルド管理協会】のカリンです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 19, 0, 0, 80003, 274, "カリン", 14, "昨日の生放送は\nいかがだったでしょうか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 20, 0, 0, 80003, 275, "カリン", 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 21, 0, 0, 80003, 276, "カリン", 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 22, 0, 0, 80003, 277, "カリン", 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 23, 0, 0, 80003, 278, "カリン", 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 24, 0, 0, 80003, 279, "カリン", 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 25, 0, 0, 80003, 280, "カリン", 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 26, 0, 0, 80003, 281, "カリン", 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 0, 27, 0, 0, 80003, 282, "カリン", 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 47, 0, 0, 80003, 283, "ペコリーヌ", 15, "準備はいいですかっ？\n…いっきますよー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 54, 0, 0, 80003, 284, "キャル", 15, "祝！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 39, 0, 0, 80003, 285, "コッコロ", 15, "2.5周年！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 48, 0, 0, 80003, 286, "ペコリーヌ", 15, "おめでとうございま～す☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 55, 0, 0, 80003, 287, "キャル", 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 40, 0, 0, 80003, 288, "コッコロ", 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 49, 0, 0, 80003, 289, "ペコリーヌ", 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 56, 0, 0, 80003, 290, "キャル", 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 41, 0, 0, 80003, 291, "コッコロ", 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 57, 0, 0, 80003, 292, "キャル", 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 50, 0, 0, 80003, 293, "ペコリーヌ", 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 58, 0, 0, 80003, 294, "キャル", 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 51, 0, 0, 80003, 295, "ペコリーヌ", 15, "記念日だから\n平気平気♪\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 59, 0, 0, 80003, 296, "キャル", 15, "意味分かんないわよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 42, 0, 0, 80003, 297, "コッコロ", 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 43, 0, 0, 80003, 298, "コッコロ", 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 52, 0, 0, 80003, 299, "ペコリーヌ", 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 2, 60, 0, 0, 80003, 300, "キャル", 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 44, 0, 0, 80003, 301, "コッコロ", 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 53, 0, 0, 80003, 302, "ペコリーヌ", 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 54, 1, 0, 80003, 303, "ペコリーヌ・コッコロ・キャル", 15, "2.5周年\nありがとうございます！", "105901,45,106001,61");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 190804, 1, 1, 0, 0, 60002, 304, "カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60002, 305, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60002, 306, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60002, 307, "", 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60002, 308, "", 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 1, 60002, 309, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60002, 310, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60002, 311, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60002, 312, "", 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60002, 313, "", 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 2, 60002, 314, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 315, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 316, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 317, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 318, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 319, "", 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60002, 320, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 3, 60002, 321, "", 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 322, "", 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 323, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 324, "", 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 325, "", 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 326, "", 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60002, 327, "", 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 4, 60002, 328, "", 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190804, 3, 2, 0, 0, 60002, 329, "カリン", 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190804, 3, 3, 0, 0, 60002, 330, "カリン", 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 1, 0, 0, 80005, 331, "コッコロ", 1, "ささ、シェフィさまはこちらへ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 1, 0, 0, 80005, 332, "シェフィ", 1, "コッコロさん、どこへ行くの…？\n…え？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 1, 0, 0, 80005, 333, "ペコリーヌ", 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 2, 0, 0, 80005, 334, "コッコロ", 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 2, 0, 0, 80005, 335, "シェフィ", 1, "ええと…\n二人とも何をしているの？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 1, 0, 0, 80005, 336, "キャル", 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 3, 0, 0, 80005, 337, "シェフィ", 1, "あの日…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 2, 0, 0, 80005, 338, "ペコリーヌ", 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 3, 0, 0, 80005, 339, "ペコリーヌ", 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 1, 0, 0, 80005, 340, "カリン", 1, "やばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 2, 0, 0, 80005, 341, "キャル", 1, "って、なにしれっと\n参加してんのよカリン！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 2, 0, 0, 80005, 342, "カリン", 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 3, 0, 0, 80005, 343, "カリン", 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 4, 0, 0, 80005, 344, "ペコリーヌ", 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 4, 0, 0, 80005, 345, "シェフィ", 1, "えっ！？　ええとええと…！\nあ、あと14日…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 5, 0, 0, 80005, 346, "ペコリーヌ", 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 3, 0, 0, 80005, 347, "コッコロ", 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 4, 0, 0, 80005, 348, "コッコロ", 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 6, 0, 0, 80005, 349, "ペコリーヌ", 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 5, 0, 0, 80005, 350, "コッコロ", 2, "さすがでございます\nペコリーヌさま", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 3, 0, 0, 80005, 351, "キャル", 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 5, 0, 0, 80005, 352, "シェフィ", 2, "しゃなり、しゃなり…\nふふ、案外できるものね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 7, 0, 0, 80005, 353, "ペコリーヌ", 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 6, 0, 0, 80005, 354, "コッコロ", 2, "さ、次はキャルさまの\n番でございますよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 4, 0, 0, 80005, 355, "キャル", 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 6, 0, 0, 80005, 356, "シェフィ", 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 5, 0, 0, 80005, 357, "キャル", 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 6, 0, 0, 80005, 358, "キャル", 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 7, 0, 0, 80005, 359, "コッコロ", 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 7, 0, 0, 80005, 360, "キャル", 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 8, 0, 0, 80005, 361, "コッコロ", 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 8, 0, 0, 80005, 362, "ペコリーヌ", 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 9, 0, 0, 80005, 363, "コッコロ", 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 7, 0, 0, 80005, 364, "シェフィ", 3, "聖学祭…って、なにかしら？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 10, 0, 0, 80005, 365, "コッコロ", 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 8, 0, 0, 80005, 366, "キャル", 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 9, 0, 0, 80005, 367, "キャル", 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 9, 0, 0, 80005, 368, "ペコリーヌ", 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 10, 0, 0, 80005, 369, "キャル", 3, "いや、そのまんますぎでしょ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 8, 0, 0, 80005, 370, "シェフィ", 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 10, 0, 0, 80005, 371, "ペコリーヌ", 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 9, 0, 0, 80005, 372, "シェフィ", 3, "えっ？　ええ…\nぎゅーっ…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 11, 0, 0, 80005, 373, "キャル", 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 10, 0, 0, 80005, 374, "シェフィ", 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 12, 0, 0, 80005, 375, "キャル", 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 11, 0, 0, 80005, 376, "コッコロ", 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 13, 0, 0, 80005, 377, "キャル", 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 11, 0, 0, 80005, 378, "ペコリーヌ", 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 14, 0, 0, 80005, 379, "キャル", 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 15, 0, 0, 80005, 380, "キャル", 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 11, 0, 0, 80005, 381, "シェフィ", 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 12, 0, 0, 80005, 382, "ペコリーヌ", 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 12, 0, 0, 80005, 383, "コッコロ", 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 16, 0, 0, 80005, 384, "キャル", 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 12, 0, 0, 80005, 385, "シェフィ", 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 13, 0, 0, 80005, 386, "ペコリーヌ", 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 14, 0, 0, 80005, 387, "ペコリーヌ", 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 15, 0, 0, 80005, 388, "ペコリーヌ", 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 17, 0, 0, 80005, 389, "キャル", 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 18, 0, 0, 80005, 390, "キャル", 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 13, 0, 0, 80005, 391, "シェフィ", 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 13, 0, 0, 80005, 392, "コッコロ", 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 16, 0, 0, 80005, 393, "ペコリーヌ", 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 19, 0, 0, 80005, 394, "キャル", 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 17, 0, 0, 80005, 395, "ペコリーヌ", 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 18, 0, 0, 80005, 396, "ペコリーヌ", 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 19, 0, 0, 80005, 397, "ペコリーヌ", 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 4, 0, 0, 80005, 398, "カリン", 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 5, 0, 0, 80005, 399, "カリン", 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 20, 0, 0, 80005, 400, "キャル", 6, "…えっ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 20, 0, 0, 80005, 401, "ペコリーヌ", 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 14, 0, 0, 80005, 402, "シェフィ", 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 14, 0, 0, 80005, 403, "コッコロ", 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 15, 0, 0, 80005, 404, "シェフィ", 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 21, 0, 0, 80005, 405, "キャル", 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 21, 0, 0, 80005, 406, "ペコリーヌ", 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 22, 0, 0, 80005, 407, "キャル", 6, "ぶっ殺すぞ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 6, 0, 0, 80005, 408, "カリン", 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 15, 0, 0, 80005, 409, "コッコロ", 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 23, 0, 0, 80005, 410, "キャル", 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 16, 0, 0, 80005, 411, "シェフィ", 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 22, 0, 0, 80005, 412, "ペコリーヌ", 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 24, 0, 0, 80005, 413, "キャル", 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 17, 0, 0, 80005, 414, "シェフィ", 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 16, 0, 0, 80005, 415, "コッコロ", 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 18, 0, 0, 80005, 416, "シェフィ", 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 17, 0, 0, 80005, 417, "コッコロ", 7, "もちろんでございます\n仲良くお勉強いたしましょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 25, 0, 0, 80005, 418, "キャル", 7, "しれっと教育ママが\n生まれてる…？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 23, 0, 0, 80005, 419, "ペコリーヌ", 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 26, 0, 0, 80005, 420, "キャル", 7, "え～～～～！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 27, 0, 0, 80005, 421, "キャル", 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 19, 0, 0, 80005, 422, "シェフィ", 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 18, 0, 0, 80005, 423, "コッコロ", 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 24, 0, 0, 80005, 424, "ペコリーヌ", 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 20, 0, 0, 80005, 425, "シェフィ", 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 28, 0, 0, 80005, 426, "キャル", 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 19, 0, 0, 80005, 427, "コッコロ", 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 21, 0, 0, 80005, 428, "シェフィ", 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 29, 0, 0, 80005, 429, "キャル", 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 30, 0, 0, 80005, 430, "キャル", 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 25, 0, 0, 80005, 431, "ペコリーヌ", 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 31, 0, 0, 80005, 432, "キャル", 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 22, 0, 0, 80005, 433, "シェフィ", 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 23, 0, 0, 80005, 434, "シェフィ", 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 24, 0, 0, 80005, 435, "シェフィ", 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 25, 0, 0, 80005, 436, "シェフィ", 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 26, 0, 0, 80005, 437, "シェフィ", 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 27, 0, 0, 80005, 438, "シェフィ", 9, "それから、それから…！\nぅ、ぅぅっ…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 28, 0, 0, 80005, 439, "シェフィ", 9, "―びえぇぇ～んっ！！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 20, 0, 0, 80005, 440, "コッコロ", 9, "どうされましたか、シェフィさま", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 29, 0, 0, 80005, 441, "シェフィ", 9, "ううっ…ひっく…\nママッ…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 21, 0, 0, 80005, 442, "コッコロ", 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 22, 0, 0, 80005, 443, "コッコロ", 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 30, 0, 0, 80005, 444, "シェフィ", 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 23, 0, 0, 80005, 445, "コッコロ", 10, "主さま\n3.5周年まであと５日\nでございます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 24, 0, 0, 80005, 446, "コッコロ", 10, "ですがその前に\n生放送がありますね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 25, 0, 0, 80005, 447, "コッコロ", 10, "…生放送に向けた\n意気込みでございますか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 26, 0, 0, 80005, 448, "コッコロ", 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 27, 0, 0, 80005, 449, "コッコロ", 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 28, 0, 0, 80005, 450, "コッコロ", 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 29, 0, 0, 80005, 451, "コッコロ", 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 30, 0, 0, 80005, 452, "コッコロ", 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 0, 31, 0, 0, 80005, 453, "コッコロ", 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 26, 0, 0, 80005, 454, "ペコリーヌ", 11, "3.5周年まであと４日！\nやばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 32, 0, 0, 80005, 455, "キャル", 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 27, 0, 0, 80005, 456, "ペコリーヌ", 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 28, 0, 0, 80005, 457, "ペコリーヌ", 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 29, 0, 0, 80005, 458, "ペコリーヌ", 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 33, 0, 0, 80005, 459, "キャル", 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 30, 0, 0, 80005, 460, "ペコリーヌ", 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 31, 0, 0, 80005, 461, "ペコリーヌ", 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 32, 0, 0, 80005, 462, "ペコリーヌ", 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 34, 0, 0, 80005, 463, "キャル", 11, "だからあたしはやるなんて一言も…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 0, 33, 0, 0, 80005, 464, "ペコリーヌ", 11, "オイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 35, 0, 0, 80005, 465, "キャル", 11, "聞きなさいっての！！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 31, 0, 0, 80005, 466, "シェフィ", 12, "3.5周年まであと３日…\nそして生放送は、明日…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 32, 0, 0, 80005, 467, "シェフィ", 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 33, 0, 0, 80005, 468, "シェフィ", 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 34, 0, 0, 80005, 469, "シェフィ", 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 35, 0, 0, 80005, 470, "シェフィ", 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 34, 0, 0, 80005, 471, "ペコリーヌ", 12, "やってますねシェフィちゃん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 36, 0, 0, 80005, 472, "キャル", 12, "なによ、考えることは\nみんな同じってこと？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 32, 0, 0, 80005, 473, "コッコロ", 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 36, 0, 0, 80005, 474, "シェフィ", 12, "みんな…もちろんよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 35, 0, 0, 80005, 475, "ペコリーヌ", 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 7, 0, 0, 80005, 476, "カリン", 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 8, 0, 0, 80005, 477, "カリン", 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 36, 0, 0, 80005, 478, "ペコリーヌ", 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 9, 0, 0, 80005, 479, "カリン", 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 33, 0, 0, 80005, 480, "コッコロ", 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 10, 0, 0, 80005, 481, "カリン", 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 37, 0, 0, 80005, 482, "キャル", 13, "大丈夫…大丈夫…\nあたしは大丈夫…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 11, 0, 0, 80005, 483, "カリン", 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 37, 0, 0, 80005, 484, "シェフィ", 13, "あうー？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 4, 37, 1, 0, 80005, 485, "みんな", 13, "あ…", "105901,34,106001,38,190801,12");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 39, 0, 0, 80005, 486, "キャル", 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 35, 0, 0, 80005, 487, "コッコロ", 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 38, 0, 0, 80005, 488, "ペコリーヌ", 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 13, 0, 0, 80005, 489, "カリン", 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 38, 0, 0, 80005, 490, "シェフィ", 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 39, 0, 0, 80005, 491, "ペコリーヌ", 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 40, 0, 0, 80005, 492, "キャル", 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 36, 0, 0, 80005, 493, "コッコロ", 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 39, 0, 0, 80005, 494, "シェフィ", 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 40, 0, 0, 80005, 495, "ペコリーヌ", 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 1, 37, 0, 0, 80005, 496, "コッコロ", 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 0, 41, 0, 0, 80005, 497, "キャル", 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 40, 0, 0, 80005, 498, "シェフィ", 14, "へ、へぇ…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 41, 0, 0, 80005, 499, "ペコリーヌ", 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 41, 0, 0, 80005, 500, "シェフィ", 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 2, 42, 0, 0, 80005, 501, "シェフィ", 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 42, 0, 0, 80005, 502, "ペコリーヌ", 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 42, 0, 0, 80005, 503, "キャル", 15, "祝！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 38, 0, 0, 80005, 504, "コッコロ", 15, "3.5周年！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 43, 0, 0, 80005, 505, "シェフィ", 15, "おめでとうございます！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 14, 0, 0, 80005, 506, "カリン", 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 190801, 2, 15, 0, 0, 80005, 507, "カリン", 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 43, 0, 0, 80005, 508, "ペコリーヌ", 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 44, 0, 0, 80005, 509, "ペコリーヌ", 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 43, 0, 0, 80005, 510, "キャル", 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106001, 1, 44, 0, 0, 80005, 511, "キャル", 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 44, 0, 0, 80005, 512, "シェフィ", 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 106401, 0, 45, 0, 0, 80005, 513, "シェフィ", 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 39, 0, 0, 80005, 514, "コッコロ", 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 40, 0, 0, 80005, 515, "コッコロ", 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105901, 4, 41, 0, 0, 80005, 516, "コッコロ", 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 3, 45, 0, 0, 80005, 517, "ペコリーヌ", 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 105801, 4, 46, 1, 0, 80005, 518, "みんな", 15, "これからも\nよろしくおねがいします！", "105901,42,106001,45,106401,46,190801,16");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 190804, 1, 1, 0, 0, 60003, 519, "カリン", 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60003, 520, "", 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60003, 521, "", 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60003, 522, "", 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 1, 60003, 523, "", 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 1, 60003, 524, "", 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60003, 525, "", 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60003, 526, "", 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60003, 527, "", 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 2, 60003, 528, "", 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 0, 2, 0, 0, 2, 60003, 529, "", 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 530, "", 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 531, "", 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 532, "", 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 533, "", 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 534, "", 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", "");
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 3, 60003, 535, "", 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", "");
