INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 0, 2, 0, 0, 4, 60005, 594, "", 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", "");
